import ReactDOM from 'react-dom'


function App(){
    

        var elements = ["element1","element2","element  3","element 4","element 5","element 6"]
        const name = "Hello";

        return(
            
           
                <ul> {

                    elements.map((element,index)=>
                         <li key={index}>{name} {element}</li>
                    )
                } </ul>
            
          
    
            
        )
    }

 ReactDOM.render(<App />,
 document.getElementById('root') );

